import React from 'react'

const BotList = ({names, setNames}) => {
  return (
    <div>
      {names.map((name) => (
        <li className='list-item' key={name.id}>
            {name.title}
          <div><button className='button-delete task-button'>
            <i className='fa fa-trash'></i></button></div>
        </li>
        )
      )}
    </div>
  )
}


export default BotList
